//topbar

import React, {Component} from 'react';
import {Navbar, Nav,} from 'react-bootstrap';

import './Topbar.css'

class Topbar extends Component {
  render() {
    return (
      <div>
      <ul id="nav">
               <li><a href="#">Home</a></li>
               <li><a href="#">About</a></li>
               <li><a href="#">FAQ</a></li>
               <li><a href="#">Contact</a></li>
             </ul>
      </div>
    )
  }
}

export default Topbar;
